import React from 'react';
import styled from 'styled-components';

const ImgDiv=styled.div`
`
const Img=styled.img`
  object-fit:cover;
  width:56px;
  height:56px;
  border-radius:50%;
  border:solid 3px red;
  overflow:hidden;
`
function StoryEle() {
  return (
    <Img src='images/activeStatus/photo.png'/>
  );
}

export default StoryEle;
